DROP TABLE `account`;

CREATE TABLE `account` (
  `id` int(8) unsigned NOT NULL auto_increment,
  `account_head` varchar(255),
  `account_sign` varchar(255),
  `communication_id` int,
  `account_name` varchar(255) default NULL,
  `account_password` varchar(255),
  `account_create_date` varchar(255),
  `account_birth_date` varchar(255),
  `account_company` varchar(255),
  `account_site` varchar(255),
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

